##########################################
### Includes
##########################################
[include macros/*.cfg]
[include mainsail.cfg]


##########################################
### mcu
##########################################
[mcu]
serial: /dev/serial/by-id/usb-Klipper_stm32h723xx_230006000651313433343333-if00

[mcu rpi]
serial: /tmp/klipper_host_mcu

[mcu sht]      
canbus_uuid: 5e4fd0540210 


##########################################
### main_printer
##########################################
[printer]
kinematics: corexy
max_velocity: 1000
max_accel: 15000
square_corner_velocity: 20.0
#max_accel_to_decel: 5000
max_z_velocity: 20
max_z_accel: 500

[pause_resume]

[respond]

[save_variables]
filename: ~/printer_data/config/variables/variables.cfg

[display_status]

[exclude_object]

[gcode_arcs]
resolution: 0.1


##########################################
### beacon
##########################################
[beacon]
serial: /dev/serial/by-id/usb-Beacon_Beacon_RevH_137DD1D54E5737374D202020FF102441-if00
speed: 5                            # Z probing dive speed.
lift_speed: 5                       # Z probing lift speed.
x_offset: 0                         # X offset of beacon from the nozzle.
y_offset: 27                        # Y offset of beacon from the nozzle.
mesh_main_direction: x              # Primary travel direction during mesh measurement.
mesh_runs: 1                        # Number of passes to make during mesh scan.
home_xy_position: 200.0, 200.0      # X, Y coordinate for homing z via contact.
home_z_hop: 5                       # Distance to retract before x/y homing moves.
home_z_hop_speed: 20                # Retraction speed for z hop.
home_xy_move_speed: 300             # Speed for moving to home_xy_position.
home_method: contact                # [contact|proximity] Sets default homing method used by G28. `proximity` requires a valid beacon model to be loaded.
home_method_when_homed: proximity   # [contact|proximity] defaults to `home_method` value # Sets the homing method when the machine is already in a homed state.
home_autocalibrate: unhomed         # [always|unhomed|never] Sets the autocalibration behavior. `always` will autocal on every home, `unhomed` on initial homing, `never` will never so that models stored in config may be used with proximity homing.
autocal_speed: 3                    # Speed during contact movement. Probing outside of 2-5mm/s not recommended and at your own risk.


##########################################
### bed_mesh
##########################################
[bed_mesh]
speed: 300
zero_reference_position: 210, 200
mesh_min: 20,30
mesh_max: 400,370
horizontal_move_z: 3
probe_count: 40, 40
algorithm: bicubic


##########################################
### resonances
##########################################
[resonance_tester]
accel_chip: beacon
probe_points: 210, 200, 20

[input_shaper]
shaper_freq_x: 83.6
shaper_freq_y: 128.0
shaper_type_x: mzv
shaper_type_y: 3hump_ei
damping_ratio_x: 0.063
damping_ratio_y: 0.009


##########################################
### ztilt.cfg
##########################################
[z_tilt]
z_positions: 
    -9.234,-10.599      #stepper_z  - front left
    216.975,417.610     #stepper_z1 - back
    443.184,-10.599     #stepper_z2 - front right
points:
    20,2
    217,340
    400,2
speed: 300
horizontal_move_z: 20
retries: 5
retry_tolerance: 0.015


##########################################
### servo.cfg
##########################################
[servo CPAPIntake]
pin: PB6
maximum_servo_angle: 180
minimum_pulse_width: 0.001
maximum_pulse_width: 0.002
initial_angle: 180


##########################################
### steppers.cfg
##########################################
[stepper_x]
# Driver 3
step_pin: PG4
dir_pin: !PC1
enable_pin: !PA2
rotation_distance: 40
microsteps: 16
full_steps_per_rotation: 200  
endstop_pin:^sht:LIMIT_1
position_endstop: 0
position_min: 0
position_max: 420
homing_speed: 50 
homing_retract_dist: 5

[stepper_y]
# Driver 2
step_pin: PF11
dir_pin: !PG3
enable_pin: !PG5
rotation_distance: 40
microsteps: 16
full_steps_per_rotation: 200  
endstop_pin: PG6
position_endstop: 0
position_min: 0
position_max: 400
homing_speed: 50  
homing_retract_dist: 5

[stepper_x1]
# Driver 1
step_pin: PG0
dir_pin: !PG1
enable_pin: !PF15
rotation_distance: 40
microsteps: 16
full_steps_per_rotation: 200

[stepper_y1]
# Driver 0
step_pin: PF13
dir_pin: !PF12
enable_pin: !PF14
rotation_distance: 40
microsteps: 16
full_steps_per_rotation: 200

[stepper_z]
# Driver 5
step_pin: PE6
dir_pin: !PA14
enable_pin: !PE0
microsteps: 16
rotation_distance: 2
full_steps_per_rotation: 200
endstop_pin: probe:z_virtual_endstop # use beacon as virtual endstop
homing_retract_dist: 0 # beacon needs this to be set to 0
position_max: 400
position_min: -3.5
homing_positive_dir: false
homing_speed: 10.0
second_homing_speed: 2.5

[stepper_z1]
# Driver 6
step_pin: PE2
dir_pin: PE3
enable_pin: !PD4
microsteps: 16
rotation_distance: 2
full_steps_per_rotation: 200

[stepper_z2]
# Driver 7
step_pin: PC13
dir_pin: PF0
enable_pin: !PF1
microsteps: 16
rotation_distance: 2
full_steps_per_rotation: 200


##########################################
### drivers
##########################################
[tmc5160 stepper_x] 
# Driver 3
cs_pin: PC7
sense_resistor: 0.022
interpolate: True
run_current: 1.8
spi_software_mosi_pin: PA7
spi_software_miso_pin: PA6
spi_software_sclk_pin: PA5

[tmc5160 stepper_y] 
# Driver 2
cs_pin: PC6
sense_resistor: 0.022
interpolate: True
run_current: 1.8
spi_software_mosi_pin: PA7
spi_software_miso_pin: PA6
spi_software_sclk_pin: PA5

[tmc5160 stepper_x1] 
# Driver 1
cs_pin: PD11
sense_resistor: 0.022
interpolate: True
run_current: 1.8
spi_software_mosi_pin: PA7
spi_software_miso_pin: PA6
spi_software_sclk_pin: PA5

[tmc5160 stepper_y1] 
# Driver 0
cs_pin: PC4
sense_resistor: 0.022
interpolate: True
run_current: 1.8
spi_software_mosi_pin: PA7
spi_software_miso_pin: PA6
spi_software_sclk_pin: PA5

[tmc2209 stepper_z]
interpolate: true
uart_pin: PD3
run_current: 1.2
stealthchop_threshold: 0

[tmc2209 stepper_z1]
interpolate: true
uart_pin: PE1
run_current: 1.2
stealthchop_threshold: 0

[tmc2209 stepper_z2]
interpolate: true
uart_pin: PE4
run_current: 1.2
stealthchop_threshold: 0


##########################################
### extruder
##########################################
[extruder]
### Vz-HextrudORT
step_pin: sht:EXT_STEP
dir_pin: !sht:EXT_DIR
enable_pin: !sht:EXT_EN
microsteps: 16
rotation_distance: 4.690
full_steps_per_rotation: 200
nozzle_diameter: 0.4
filament_diameter: 1.750
heater_pin: sht:HE0
sensor_pin: sht:TH0
sensor_type: PT1000
pullup_resistor:1100
control: pid
pid_Kp: 23.293
pid_Ki: 2.724
pid_Kd: 49.789
min_temp: 0
max_temp: 400
max_extrude_only_distance: 1000.0
max_extrude_cross_section: 500
max_extrude_only_velocity: 200
max_extrude_only_accel: 10000
min_extrude_temp: 190
pressure_advance: 0.04
pressure_advance_smooth_time: 0.040

[tmc2209 extruder]
uart_pin: sht:EXT_UART
diag_pin: sht:EXT_DIAG
run_current: 0.5
sense_resistor: 0.110

[angle ext_as]
sensor_type: as5047d
#sample_period: 0.000400
stepper: extruder
cs_pin: sht:PC14
#spi_bus: sht:spi1
spi_software_sclk_pin: sht:PA5
spi_software_mosi_pin: sht:PA7
spi_software_miso_pin: sht:PA6

##########################################
### temperature
##########################################
[temperature_sensor OctopusPro]
sensor_type: temperature_mcu

[temperature_sensor raspberry_pi]
sensor_type: temperature_host
min_temp: 10
max_temp: 100

[temperature_sensor sht]
sensor_type: temperature_mcu
sensor_mcu: sht

[temperature_sensor ChamberBot]
sensor_type: Generic 3950
sensor_pin:sht:TC0

[temperature_sensor ChamberTop]
sensor_type: Generic 3950
sensor_pin: PF4


##########################################
### fans
##########################################
[heater_fan hotend_fan]
pin: sht:FAN0
max_power: 1.0
kick_start_time: 0.5
heater: extruder
heater_temp: 50.0

[fan]
##	CPAP Print Cooling Fan - PF8
pin: PG12
max_power: 0.5
kick_start_time: 0.3
off_below: 0.2
cycle_time: 0.0003
hardware_pwm: false
shutdown_speed: 0

[fan_generic AirFilter]
pin: PA8
max_power: 1.0

[fan_generic DriverFans]
pin: PE5
max_power: 1.0

[fan_generic MotorFans]
pin: PD12
max_power: 1.0


##########################################
### heaters
##########################################
[heater_bed]
heater_pin: PA1
sensor_type: Generic 3950
sensor_pin: PF3
control: pid
pid_Kp: 69.855
pid_Ki: 3.168
pid_Kd: 385.074
min_temp: 0
max_temp: 130


##########################################
### shaketune
##########################################
[shaketune]
result_folder: ~/printer_data/config/ShakeTune_results
number_of_results_to_keep: 10
keep_raw_data: True
show_macros_in_webui: True
timeout: 600
measurements_chunk_size: 2
max_freq: 200
dpi: 300


